import React, { useEffect, useState } from "react";
import { Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";
import SurveyResult from "./components/SurveyResult";
import Main from "./components/Main";
import Mypage from "./components/Mypage";
import WishList from "./components/WishList";
import Preview from "./components/Preview";
import Login from "./components/Login";
import Join from "./components/member/Join";
import Delete from "./components/member/Delete";
import NutritionInfo from "./components/Main/NutritionInfo";
import ResultSameNutri from "./components/wishList/ResultSameNutri";
import ResultOtherNutri from "./components/wishList/ResultOtherNutri";
import SurveyNew from "./components/SurveyNew";
import NutriDetail from "./components/Nutri/NutriDetail";
import ProductDetail from "./components/Product/ProductDetail";

function App() {
  //제품 상세 정보 불러오는 함수 (찜하기, 제품 상세페이지에서 사용)

  // 제품 정보 변수
  //1행
  const [img, setImg] = useState("");
  const [title, setTitle] = useState("");
  const [price, setPrice] = useState();
  const [packageUnit, setPackageUnit] = useState();
  const [nutri, setNutri] = useState("");
  const [menufacturer, setMenufacturer] = useState("");
  //2행
  const [dailyPrice, setDailyPrice] = useState();
  const [dailyIntake, setDailyIntake] = useState("");
  const [withGood, setWithGood] = useState([]);
  const [withBad, setWithBad] = useState([]);
  //3행
  const [dayMany, setDayMany] = useState("");
  const [dayTimes, setDayTimes] = useState("");
  const [dayWhen, setDayWhen] = useState("");
  const [bfAfMeal, setBfAfMeal] = useState("");
  const [note, setNote] = useState("");
  //버튼
  const [url, setUrl] = useState("");

  //함수
  useEffect(() => {
    console.log("productId :", productId);
    setImg(location.state.img);
    setWithGood(location.state.withNutri);
    setWithBad(location.state.withNotNutri);
    setDailyIntake(location.state.dailyRecTake);
    console.log(img);
    axios
      .get(`http://localhost:8085/haru/product/${productId}`)
      .then((res) => {
        console.log("제품상세페이지 통신성공", res.data);
        let data = res.data.recNutri;
        setTitle(data.detail_name);
        setPrice(data.detail_price);
        setPackageUnit(data.pack_unit + data.shape);
        setNutri(data.nutri_name);
        setMenufacturer(data.manufacturer);
        setDailyPrice(
          data.detail_price /
            parseInt(data.pack_unit) /
            (data.day_many * parseInt(data.day_times))
        );
        setDayMany(data.day_many);
        setDayTimes(data.day_times);
        setDayWhen(data.day_when);
        setBfAfMeal(data.bf_af_meal);
        setNote(data.intake_precaution);
        setUrl(data.detail_url);
      })
      .catch((e) => {
        console.log("error : ", e);
      });
  }, []);

  return (
    <div>
      <Header />
      <Routes>
        <Route path="/haru/preview" element={<Preview />} />
        <Route path="/haru/survey" element={<SurveyNew />} />
        <Route path="/haru/survey/result" element={<SurveyResult />} />
        <Route path="/haru/main" element={<Main />} />
        <Route path="/haru/mypage" element={<Mypage />} />
        <Route path="/haru/wishlist" element={<WishList />} />
        <Route path="/haru/login" element={<Login />} />
        <Route path="/haru/join" element={<Join />} />
        <Route path="/haru/delete" element={<Delete />} />
        <Route path="/haru/info/nutri" element={<NutritionInfo />} />
        <Route path="/haru/wishlist/samenutri" element={<ResultSameNutri />} />
        <Route
          path="/haru/wishlist/othernutri"
          element={<ResultOtherNutri />}
        />
        <Route path="haru/"></Route>
        <Route path="/haru/nutri/:nutri_name" element={<NutriDetail />} />
        <Route path="/haru/product/:productId" element={<ProductDetail />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
